from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class Version(_Message):

    # None
    major: uint8_t
    # None
    minor: uint8_t
    # None
    patch: uint8_t
    # None
    build: uint16_t


class VersionDict(TypedDict):

    # None
    major: Union[uint8_t, int ]

    # None
    minor: Union[uint8_t, int ]

    # None
    patch: Union[uint8_t, int ]

    # None
    build: Union[uint16_t, int ]

